import Parse = require("parse/node");
import { OmniChatSchema } from './Schema'
import { Retailer } from './Retailer';

export class GoogleXml extends Parse.Object {
  constructor(attributes?: any) {
    super('GoogleXml', attributes)
  }

  /** Integration status  */
  get status(): OmniChatSchema.GoogleXmlStatus { return this.get('status') }
  set status(value: OmniChatSchema.GoogleXmlStatus) { this.set('status', value) }

  get url(): string { return this.get('url') }
  set url(value: string) { this.set('url', value) }

  get retailer(): Retailer { return this.get('retailer') }
  set retailer(value: Retailer) { this.set('retailer', value) }

}

Parse.Object.registerSubclass('GoogleXml', GoogleXml);